__global__ void DrawCycloid(RGB *frame, RGB *lastframe, const int t) {
	const int y = blockIdx.y * blockDim.y + threadIdx.y;
	const int x = blockIdx.x * blockDim.x + threadIdx.x;
	const int index = y*W+x;

	const int coord_x = x;
	const int coord_y = (W - y + 1) - (W - 428);
	const int center_x = 3*t;
	const int center_y = 50;
	const float param_x = (float)center_y * ((float)center_x / (float)center_y - __sinf((float)center_x / (float)center_y));
	const float param_y = (float)center_y * (1.f - __cosf((float)center_x / (float)center_y));

	if (y >= 427 && y < 430 && x < W) {
		frame[index].r = 255;
		frame[index].g = 255;
		frame[index].b = 255;
	}
	else if ( (coord_y - center_y) * (coord_y - center_y) + (coord_x - center_x) * (coord_x - center_x) <= 2500 &&
		(coord_y - center_y) * (coord_y - center_y) + (coord_x - center_x) * (coord_x - center_x) >= 2209) {
		frame[index].r = 0;
		frame[index].g = 255;
		frame[index].b = 0;
	}
	else if (y < H && x < W) {
		frame[index].r = 0;
		frame[index].g = 0;
		frame[index].b = 0;
	}

	if ( ((float)coord_x - param_x) * ((float)coord_x - param_x) + ((float)coord_y - param_y) * ((float)coord_y - param_y) <= 16.f ) {
		frame[index].r = 255;
		frame[index].g = 0;
		frame[index].b = 0;
	}
	else if (t != 0 && lastframe[index].r == 255 && lastframe[index].g == 0 && lastframe[index].b == 0) {
		frame[index].r = 255;
		frame[index].g = 0;
		frame[index].b = 0;
	}

	// write to last frame
	lastframe[index].r = frame[index].r;
	lastframe[index].g = frame[index].g;
	lastframe[index].b = frame[index].b;

}
