__global__ void DrawConway(RGB *frame, const Cellstatus *status, const int t) {
	const int y = blockIdx.y * blockDim.y + threadIdx.y;
	const int x = blockIdx.x * blockDim.x + threadIdx.x;
	const int index = y*W+x;

	const int coord_x = x / SCALE;
	const int coord_y = y / SCALE;
	const int statusindex = coord_y*CONWAY_W + coord_x;

	if (index < W*H) {
		frame[index].r = (status[statusindex].alive == true)? 255: 0;
		frame[index].g = (status[statusindex].alive == true)? 255: 0;
		frame[index].b = (status[statusindex].alive == true)? 255: 0;
		if (status[statusindex].alive == true && status[statusindex].prev == false) {
			frame[index].r = 255;
			frame[index].g = 0;
			frame[index].b = 255;
		}

	}

}

__global__ void UpdateConway(Cellstatus *status) {
	const int y = blockIdx.y * blockDim.y + threadIdx.y;
	const int x = blockIdx.x * blockDim.x + threadIdx.x;
	const int index = y*(CONWAY_W)+x;


	if (index < (CONWAY_W)*(CONWAY_H)) {
		const int surroundings_x[8] = 
			{(x-1), (x), (x+1),
			(x-1), (x+1), 
			(x-1), (x), (x+1)};
		const int surroundings_y[8] = 
			{(y-1), (y-1), (y-1),
			(y), (y), 
			(y+1), (y+1), (y+1)};

		//int counter = 0;
		status[index].counter = 0;
		for (int i = 0; i < 8; ++i) {
			if (surroundings_x[i] >= 0 && surroundings_x[i] < (CONWAY_W) && 
				surroundings_y[i] >= 0 && surroundings_y[i] < (CONWAY_H) && 
				status[surroundings_y[i]* (CONWAY_W) + surroundings_x[i]].prev == true)
				status[index].counter++;
		}


		// dead
		if (status[index].prev == true && status[index].counter < 2) {
			status[index].alive = false;
		}
		// keep alive
		else if (status[index].prev == true && status[index].counter == 2) {
			status[index].alive = true;
		}
		// dead
		else if (status[index].prev == true && status[index].counter > 3) {
			status[index].alive = false;
		}
		// newly born
		else if (status[index].counter == 3) {
			status[index].alive = true;
		}
		else {
			status[index].alive = false;
		}


	}
}

__global__ void ShiftToPrevConway(Cellstatus *lastframe) {
	const int y = blockIdx.y * blockDim.y + threadIdx.y;
	const int x = blockIdx.x * blockDim.x + threadIdx.x;
	const int index = y*(CONWAY_W)+x;
	if (index < (CONWAY_W)*(CONWAY_H)) {
		lastframe[index].prev = lastframe[index].alive;
	}
}

